// src/components/EmployeeList.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const EmployeeList = () => {
    const [employees, setEmployees] = useState([
        { _id: '1', name: 'Dr. Alice Johnson', role: 'Vet' },
        { _id: '2', name: 'Mark Spencer', role: 'Groomer' },
        { _id: '3', name: 'Linda Carter', role: 'Admin' },
        { _id: '4', name: 'Dr. Robert Brown', role: 'Vet' },
    ]);

    return (
        <div style={{ padding: '20px' }}>
            <h2 style={{ color: 'navy' }}>Employee List</h2>
            <ul style={{ listStyleType: 'none', padding: 0 }}>
                {employees.map(emp => (
                    <li key={emp._id} style={{ margin: '5px 0', padding: '10px', backgroundColor: '#f4f4f4', borderRadius: '5px' }}>
                        {emp.name} - {emp.role}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default EmployeeList;
